% ////////////////////////////// L100S50 ////////////////////////////////

[rowsA1, colsA1] = size(A1);

% links capacity 80000 ~ 80GB ; 10 ~ 10MB
ll_cap = 2000;
sl_cap = 1000;

% links cost 
ll_cost = 1000; % B_0.3 to 0.45; D; 
sl_cost = 1;

% adjust capacity A S30L90 
for i =1:rowsA1
	for j=1:colsA1
		if A1(i,j) ~= 0
			if A1(i,j) == 80000 % longlink
				A1(i,j) = ll_cap;
			else
				A1(i,j) = sl_cap;	
			end
		end
	end
end

A1_org = A1;


% Generate the cost matrix G1
G1 = zeros(colsA1, rowsA1);
%counter = 100;
for i=1:rowsA1
	for j = 1:colsA1
		if A1(i,j) == ll_cap 
			%counter = counter + ll_cost;
			G1(i,j) = ll_cost;
		else
		 	if A1(i,j) == sl_cap
				G1(i,j) = sl_cost;
			end
		end
	end
end
% save an org. version
G1_org = G1;


% traffic
[rowsD1, colsD1] = size(D1);

countD1 = 0; % count #inputs.
countD1x = 0; % for running back.
countTerminate=0; % count up for terminating in case of infeasible solutions.
numTerminate=100; % terminate if reaching this number => infeasible solution.

A2 = zeros(rowsA1,colsA1); % store minf in each iteration.
A3 = zeros(rowsA1,colsA1); % store accumulative allocated traffic on links 
% break;
countRowsD1 = rowsD1; % countRowsD1 will be updated with countD1x after running all traffic, then can run remaining traffic that was bottle-necked in the first try.

% ---------------------------
fid1 = fopen('result/path_output_S1G_L2G_tA_ffm.txt','wt');
fid2 = fopen('result/matrix_output_S1G_L2G_tA_ffm.txt','wt');
% ---------------------------

tic 

src_tem=0;

src_org=0; dst_org=0; count_sd_loc=0;
while countD1 ~= countRowsD1

	countD1=countD1+1;
	[check_BN,cost,minf]=netSimplex(A1,D1(countD1,:),G1); % minflow
	
	display(check_BN);
	display(countD1);
	display(countTerminate);
	
	if sum(sum(minf)) == 0 || check_BN ~=0
		% save D1(countD1,:) for running back later.
		countD1x = countD1x +1;
		D1x(countD1x,:) = D1(countD1,:);
	else
		% get s-d location
		[org D1_len] = size(D1(countD1,:));
		for i=1:D1_len
			if D1(countD1,i)~=0
				count_sd_loc = count_sd_loc +1;
				if D1(countD1,i)>0
					dst_org = i;
					trafficValue = D1(countD1,i);
				else
					if D1(countD1,i)<0
						src_org = i;
					end
				end

				if count_sd_loc==2
					count_sd_loc=0; % reset
					break; % dont count other zeros.
				end
			end
		end

		path1 = pathbetweennodes(minf, src_org, dst_org, trafficValue, false);

		% extract paths along with its traffic
		ii=0;
		while ii~=size(path1,1)
			ii=ii+1;
			% output: source dest path its_traffic
			path1{ii} = [src_org dst_org path1{ii}];
			fprintf(fid1, '%2d ', path1{ii});
			fprintf(fid1, '\n');
		end
		% update the capacity
		for i=1:rowsA1
			for j=1:colsA1
				if minf(i,j)~=0
					minf(j,i) = minf(i,j);
				end
			end
		end
		A2 = minf; 
		A3 = A3 + A2; % accumulative traffic on links.
		A1 = A1 - A2; % update remaining capacity to A1.


		% update the cost
		for i = 1:rowsA1
			for j = 1:colsA1
				if A2(i,j) ~=0
					if (G1(i,j) ~= sl_cost && G1(i,j)>0) %|| (G1(jx,ix) ~= sl_cost && G1(jx,ix)>0)
						G1(i,j) = sl_cost;
						% G1(jx,ix) = sl_cost;
						display(A2(i,j));
						disp('i'); disp(i);
						disp('j'); disp(j);
						% display(A2(jx,ix));
					end
				end
			end
		end
		% 
		A2 = zeros(rowsA1,colsD1); % reset 		

	end

	% store for later injection
	if countD1 == rowsD1
		if countD1x ~=0 
			% countD1 = countD1 - countD1x; % 
			countD1 = 0; countRowsD1=countD1x;
			D1 = D1x; % add D1x back to D1.
			countTerminate = countTerminate +1;
		end
	end

	% terminator section
	if countTerminate == numTerminate
		disp('Infeasible solution! Terminated!');
		for ii=1:5 % waiting loop
			for jj=1:100
				disp(ii);
			end
		end
		break;
	end

end

fclose(fid1)

% output all traffic allocation A3.
for ii = 1:size(A3,1)
    fprintf(fid2,'%g\t',A3(ii,:));
    fprintf(fid2,'\n');
end

toc 

fclose(fid2)

A4 = A; % write A4 to text file; A contains shortlinks only.

% count number of long links
ll_count_1=0; ll_count_2=0; ll_count=0;
for i=1:rowsA1
	for j=1:colsA1
		if A3(i,j) ~=0 && (G1_org(i,j) ~= sl_cost && G1_org(i,j)>0 )
			if A3(j,i) ~=0 && (G1_org(i,j) ~= sl_cost && G1_org(i,j)>0 )
				ll_count_2 = ll_count_2 +1;
				A4(i,j) = 2; A4(j,i) = 2;
			else 
				if A3(j,i) ==0 && (G1_org(j,i) ~= sl_cost && G1_org(j,i)>0 )
					ll_count_1 = ll_count_1 +1;
					A4(i,j) = 2; A4(j,i) = 2;
				end
			end 
		end
	end
end
ll_count = ll_count_1 + ll_count_2/2;
display(ll_count);


