fid = fopen('result/output_S1G_L2G_tA_ffm.txt','wt');
% ---------------------------
for ii = 1:size(A4,1)
    fprintf(fid,'%g\t',A4(ii,:));
    fprintf(fid,'\n');
end
fprintf(fid,'\n');
fprintf(fid,'%d', ll_count);
fprintf(fid,'\n');

